import React, { useState } from 'react';
import { Link } from 'react-router-dom';

export default function CaseDetails() {
  const [activeTab, setActiveTab] = useState('service');

  const renderContent = () => {
    switch (activeTab) {
      case 'service':
        return (
          <div style={mainContentStyle}>
            <h2 style={contentHeaderStyle}>Service AI - Case Details</h2>
            {/* Add the existing case details content here */}
            <p>This section displays case details for the Service AI tab.</p>
            <div style={knowledgeBaseStyle}>
              <h3 style={contentHeaderStyle}>Knowledge Base</h3>
              {/* Sample articles */}
              <div style={articleContainerStyle}>
                <div style={articleHeaderStyle}>
                  <span style={articleTitleStyle}>What is Droplet Digital PCR technology...</span>
                  <i className="fas fa-ellipsis-v" style={iconStyle}></i>
                </div>
                <p style={articleContentStyle}>ddPCR enables the measurement of thousands of independent...</p>
                <div style={articleFooterStyle}>
                  <span style={articleDetailLinkStyle}>Article Details</span>
                  <span style={articleRelevanceStyle}>70% relevant</span>
                </div>
              </div>
            </div>
          </div>
        );
      case 'sales':
        return (
          <div style={mainContentStyle}>
            <h2 style={contentHeaderStyle}>Sales AI - Leads</h2>
            <p>This section will list leads for the Sales AI tab.</p>
          </div>
        );
      case 'compliance':
        return (
          <div style={mainContentStyle}>
            <h2 style={contentHeaderStyle}>Compliance AI - Document Upload</h2>
            <div>
              <label htmlFor="file-upload" style={fileUploadLabelStyle}>Upload Marketing Document:</label>
              <input type="file" id="file-upload" style={fileUploadInputStyle} />
              <button style={actionButtonStyle('#0070d2')}>Submit for Review</button>
            </div>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div style={containerStyle}>
      {/* Header */}
      <div style={headerStyle}>
        <div style={logoStyle}>
          <div style={logoIconStyle}>
            <i className="fas fa-heart" style={iconInsideLogoStyle}></i>
          </div>
          <span style={logoTextStyle}>Pay Pros Co.</span>
        </div>
        <div style={tabsContainerStyle}>
          <div style={activeTab === 'service' ? activeTabStyle : tabStyle} onClick={() => setActiveTab('service')}>
            Service AI
            {activeTab === 'service' && (
              <div style={subMenuStyle}>
                <Link to="/home" style={subMenuItemStyle}>Home</Link>
                <Link to="/accounts" style={subMenuItemStyle}>Accounts</Link>
                <Link to="/contacts" style={subMenuItemStyle}>Contacts</Link>
                <Link to="/cases" style={subMenuItemStyle}>Cases</Link>
                <Link to="/reports" style={subMenuItemStyle}>Reports</Link>
                <Link to="/dashboards" style={subMenuItemStyle}>Dashboards</Link>
              </div>
            )}
          </div>
          <div style={activeTab === 'sales' ? activeTabStyle : tabStyle} onClick={() => setActiveTab('sales')}>
            Sales AI
            {activeTab === 'sales' && (
              <div style={subMenuStyle}>
                <Link to="/home" style={subMenuItemStyle}>Home</Link>
                <Link to="/accounts" style={subMenuItemStyle}>Accounts</Link>
                <Link to="/contacts" style={subMenuItemStyle}>Contacts</Link>
                <Link to="/leads" style={subMenuItemStyle}>Leads</Link>
                <Link to="/reports" style={subMenuItemStyle}>Reports</Link>
                <Link to="/dashboards" style={subMenuItemStyle}>Dashboards</Link>
              </div>
            )}
          </div>
          <div style={activeTab === 'compliance' ? activeTabStyle : tabStyle} onClick={() => setActiveTab('compliance')}>
            Compliance AI
            {activeTab === 'compliance' && (
              <div style={subMenuStyle}>
                <Link to="/home" style={subMenuItemStyle}>Home</Link>
                <Link to="/accounts" style={subMenuItemStyle}>Accounts</Link>
                <Link to="/contacts" style={subMenuItemStyle}>Contacts</Link>
                <Link to="/compliance" style={subMenuItemStyle}>Upload Document</Link>
                <Link to="/reports" style={subMenuItemStyle}>Reports</Link>
                <Link to="/dashboards" style={subMenuItemStyle}>Dashboards</Link>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* Content */}
      {renderContent()}
    </div>
  );
}

// Styles
const containerStyle = {
  backgroundColor: '#f5f5f5',
  padding: '20px',
  minHeight: '100vh',
  fontFamily: 'Arial, sans-serif',
};

const headerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  backgroundColor: '#ffffff',
  padding: '12px 24px',
  borderRadius: '12px',
  boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
  marginBottom: '20px',
};

const logoStyle = {
  display: 'flex',
  alignItems: 'center',
};

const logoIconStyle = {
  width: '40px',
  height: '40px',
  backgroundColor: '#0070d2',
  borderRadius: '50%',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  marginRight: '12px',
};

const iconInsideLogoStyle = {
  color: '#ffffff',
  fontSize: '18px',
};

const logoTextStyle = {
  fontSize: '20px',
  fontWeight: 'bold',
  color: '#333333',
};

const tabsContainerStyle = {
  display: 'flex',
  alignItems: 'center',
  gap: '32px',
};

const tabStyle = {
  padding: '10px 20px',
  cursor: 'pointer',
  color: '#0070d2',
  fontWeight: 'bold',
  borderRadius: '25px',
  transition: 'background-color 0.3s ease, color 0.3s ease',
  boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.1)',
  backgroundColor: '#ffffff',
};

const activeTabStyle = {
  ...tabStyle,
  backgroundColor: '#0070d2',
  color: '#ffffff',
  boxShadow: '0px 6px 12px rgba(0, 0, 0, 0.2)',
  position: 'relative',
};

const subMenuStyle = {
  display: 'flex',
  flexDirection: 'row',
  padding: '10px 0',
  marginTop: '10px',
  borderTop: '1px solid #e0e0e0',
  backgroundColor: '#f7f9fc',
  borderRadius: '12px',
  boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.1)',
};

const subMenuItemStyle = {
  color: '#0070d2',
  textDecoration: 'none',
